#pragma once

// https://codecraft.co/2014/11/25/variadic-macros-tricks/

// Accept any number of args >= N, but expand to just the Nth one. The macro
// that calls us still only supports 4 args, but the set of values we might
// need to return is 1 larger, so we increase N to 6.
// #define _GET_NTH_ARG(_1, _2, _3, _4, _5, N, ...) N

// Count how many args are in a variadic macro. We now use GCC/Clang's extension
// to
// handle the case where ... expands to nothing. We must add a placeholder arg
// before
// ##__VA_ARGS__ (its value is totally irrelevant, but it's necessary to
// preserve
// the shifting offset we want). In addition, we must add 0 as a valid value to
// be in
// the N position.
// #define COUNT_VARARGS(...) _GET_NTH_ARG("ignored", ##__VA_ARGS__, 4, 3, 2, 1,
// 0)

// Define two overrides that can be used by the expansion of
// our main macro.

#if defined(_MSC_VER)
#if _MSC_VER >= 1800 
#define SAFE_ENUM_USE_CPP11
#endif
#elif __cplusplus >= 201103L
#define SAFE_ENUM_USE_CPP11
#endif

namespace util
{
	namespace safe_enum
	{
		namespace detail
		{
			struct init_test
			{
				init_test()
					: init(false)
				{
				}
				init_test(int x)
					: init(true)
					, val(x)
				{
				}
				operator int()
				{
					return val;
				}
				bool init;
				int  val;
			};
		}
	}
}

